import React from 'react';
import Nav from "../components/main/Nav";
import SignUpBox from "../components/main/SignUpBox";
import IndexIntro from "../components/main/IndexIntro";
import Footer from "../components/main/Footer";
import axios from "axios";

const Index = () => {
    const styles = {
        root: {
            display: 'flex',
            flexDirection: 'column',
            justifyContent: 'center',
            height: '100%',
        },
        layout: {
            display: 'flex',
            height: '100%',
            overflow: 'hidden',
            alignItems: 'center',
            alignContent: 'center',
            justifyContent: 'center',
            verticalAlign: 'center'
        }
    }


    return (
        <>
            <div style={styles.root}>
                <Nav/>
                <div style={styles.layout}>
                    <IndexIntro/>
                    <SignUpBox/>
                </div>
                <Footer />
            </div>
        </>
    );
};

export default Index;
